import React from 'react';
import '../../App.css';
import NavBar from '../Navbar'

function Playlist() {
  return (
    <>
      <NavBar />
      <h1 className='playlist'>CREATE THE PLAYLIST HERE!</h1>;
    </>
  );
}

export default Playlist;
